import "./FormContainer.css";

const FormContainer = () => {
  return (
    <div className="first-name-group">
      <div className="first-name1">First Name:</div>
      <div className="middle-name1">Middle Name:</div>
      <div className="last-name1">Last Name:</div>
      <div className="email4">
        <span className="email5">Email</span>
        <span>:</span>
      </div>
      <div className="password1">Password</div>
      <div className="confirm-password">Confirm Password:</div>
      <div className="group-child19" />
      <div className="group-child20" />
      <div className="group-child21" />
      <div className="group-child22" />
      <div className="group-child23" />
      <div className="group-child24" />
    </div>
  );
};

export default FormContainer;
